 //     return this.http.post( 'request', {username, password});\n    // }\n\n    login(username: string , password: string): Observable {\n\n        const headers = new HttpHeaders ({\n            'Content-Type': 'application/json',\n            Accept: 'application/json',\n        });\n        const body = {\n            username,\n            password\n        };\n        // return this.http.post('https://930d0c7c.ngrok.io/api/v1/unauth/signIn', body, { headers });\n        return this.http.post('http://35.204.169.121/api/v1/unauth/signIn', body, { headers });\n    }\n\n\n    SignUp(username: string , password: string, email: string, password_confirmation: string): Observable {\n\n        const headers = new HttpHeaders ({\n            'Content-Type': 'application/json',\n            Accept: 'application/json',\n        });\n        const body = {\n            username,\n            email,\n            password,\n            password_confirmation\n        };\n\n        return this.http.post('https://930d0c7c.ngrok.io/api/v1/unauth/signIn', body, { headers });\n    }\n    /**\n     * to send a request contains the email\n     */\n    next(email: string): Observable {\n        return this.http.post( 'request', {email});\n\n    }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/LoginComponent.html":{"url":"components/LoginComponent.html","title":"component - LoginComponent","body":"\n                   \n\n\n\n\n\n  Components\n  LoginComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/login/login.component.ts\n\n\n\n\n    \n        Implements\n    \n    \n                    OnInit\n    \n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n